import Card from 'react-bootstrap/Card'
import { Carousel, Container } from 'react-bootstrap'
import classes from './Other.module.css'

import am from '../assets/Amser.png'
import amre from '../assets/AmserReview.png'
import car360 from '../assets/Cardiff360.png'
import carcon from '../assets/CardiffConsul.png'
import fm from '../assets/ForwardMotion.png'
import og from '../assets/Overgrown.png'
import yg from '../assets/Youngrevolt.png'

const Other = () => {
  return (
    <>
      <Card
        bg="secondary" text="white" className={classes.cardbody}>
        <Card.Body>
          <Card.Title><b>Other</b></Card.Title>
          <Card.Text>
            Here you will find some of my other creative work.
          </Card.Text>
        </Card.Body>
      </Card>
      <Container className={classes.carouselcontainer}>
        <Carousel >
          <Carousel.Item>
            <img
              className={classes.carouselimage}
              src={am}
              alt="First slide"
            />
            <Carousel.Caption className={classes.carouselcaption}>
              <h4>Amser</h4>
              <p>Recorded and engineered in The Atrium Studios, United Kingdom by Adrian Strozzi</p>
            </Carousel.Caption>
          </Carousel.Item>
          <Carousel.Item>
            <img
              className={classes.carouselimage}
              src={amre}
              alt="Second slide"
              href="https://rafaelbarreramusic.bandcamp.com/album/amser"
            />
            <Carousel.Caption>
              <h4>Amser Review</h4>
              <p>Amser Review by Contratiempo Jazz</p>
            </Carousel.Caption>
          </Carousel.Item>
          <Carousel.Item>
            <img
              className={classes.carouselimage}
              src={car360}
              alt="Third slide"
            />
            <Carousel.Caption>
              <h4>Cardiff 360 with Spatial Audio</h4>
              <p>Produced by Adrian Strozzi</p>
            </Carousel.Caption>
          </Carousel.Item>
          <Carousel.Item>
            <img
              className={classes.carouselimage}
              src={carcon}
              alt="Third slide"
            />
            <Carousel.Caption>
              <h4>Honorary Consul For Mexico in Wales</h4>
              <p>Mention from Honorary Consul Glynn Pegler</p>
            </Carousel.Caption>
          </Carousel.Item>
          <Carousel.Item>
            <img
              className={classes.carouselimage}
              src={fm}
              alt="Third slide"
            />
            <Carousel.Caption>
              <h4>Forward Motion Single by Rafael Barrera</h4>
              <p>Recorded and engineered in The Atrium Studios, United Kingdom by Adrian Strozzi</p>
            </Carousel.Caption>
          </Carousel.Item>
          <Carousel.Item>
            <img
              className={classes.carouselimage}
              src={og}
              alt="Third slide"
            />
            <Carousel.Caption>
              <h4>Overgrown Single by Cardiff Band "Joby"</h4>
              <p>Recorded and engineered in The Atrium Studios, United Kingdom by Adrian Strozzi</p>
            </Carousel.Caption>
          </Carousel.Item>
          <Carousel.Item>
            <img
              className={classes.carouselimage}
              src={yg}
              alt="Third slide"
            />
            <Carousel.Caption>
              <h4>Young Revolt</h4>
              <p>Band single. Music and lyrics by Adrian Strozzi.</p>
            </Carousel.Caption>
          </Carousel.Item>
        </Carousel>
      </Container>
    </>
  )
}

export default Other;



